import React, {Component} from 'react';

class Home extends Component {
    render(){
        return (
                <div className="mt-5 p-1">
                    <h1 className="m-2">Welcome to Quizorus</h1>
                    <p>
                        Signup or login to start your learning journey!
                    </p>
                </div>
        )
    }
}

export default Home;
